import React, { useRef } from 'react'
import { Link } from "react-router-dom";

const Video = (props) => {
  const video_url  = props.video_url;
  const data = useRef();

  const handleClick = () => {
    localStorage.setItem("videoUrl", video_url)
  }

  const linkStyle = {
    color: 'black',
    fontSize: '18px'
  };

  return (
    <div className="videoContent">
      <div className="videoUpperContent">
        <video width="558" height="290" controls>
          <source type="video/mp4" src={video_url.slice(0,25) + "uc?export=view&id=" + video_url.slice(32,65)}></source>
        </video>
      </div>

      <div className="videoLowerContent">
        <button id='view-VideoDetails' onClick={handleClick}>
          <Link to="/videoDetails" style={linkStyle} state={video_url} ref={data}>Video Details</Link>
        </button>
      </div>  
    </div>
  )
}

export default Video


